import React from 'react';
import {Route, Routes, Navigate} from 'react-router-dom'
import {authRoutes} from "../routes";

const AppRouter = () => {
    const isAuth = false
    return (
        <Routes>
            {authRoutes.map(({path, Component}))}
        </Routes>
    );
};

export default AppRouter;
